import { AILogoPrompt } from "@/configs/AiModel";
import { NextResponse } from "next/server";
import { db } from "@/configs/FirebaseConfig";
import { doc, setDoc } from "firebase/firestore";
import axios from "axios";

export async function POST(req) {
  const { prompt, email, title, desc, type } = await req.json();
  console.log("Received prompt:", prompt);
  let base64ImageWithMine = "";
  // const replicate = new Replicate({
  //   auth: process.env.REPLICATE_API_TOKEN,
  // });
  try {
    // Create a new chat session for each request
    const AiPromptResult = await AILogoPrompt.sendMessage(prompt);
    console.log("AI Response:", AiPromptResult);

    // Parse the response text and extract the JSON
    const responseText = AiPromptResult.response.text();
    const jsonMatch = responseText.match(/```json\n([\s\S]*?)\n```/);
    const jsonStr = jsonMatch ? jsonMatch[1] : responseText;
    const AIPrompt = JSON.parse(jsonStr).prompt; //to  print the exact promt

    try {
      if (type == "Free") {
        console.log("Sending prompt to Hugging Face:", AIPrompt);
        const response = await axios.post(
          "https://router.huggingface.co/hf-inference/models/black-forest-labs/FLUX.1-dev",
          { inputs: AIPrompt },
          {
            headers: {
              Authorization: `Bearer ${process.env.HUGGING_FACE_API_KEY}`,
              "Content-Type": "application/json",
            },
            responseType: "arraybuffer",
          }
        );
        const buffer = Buffer.from(response.data);
        console.log("Buffer created, length:", buffer.length);

        const base64Image = buffer.toString("base64");
        console.log("Base64 string length:", base64Image.length);

        base64ImageWithMine = `data:image/jpeg;base64,${base64Image}`;
        console.log("Final image string length:", base64ImageWithMine.length);

        console.log("Response status:", response.status);
        console.log("Response headers:", response.headers);
        console.log("Response data type:", typeof response.data);
        console.log("Response data length:", response.data.length);

        if (!response.data || response.data.length === 0) {
          throw new Error("Empty response from Hugging Face API");
        }
      } else {
        base64ImageWithMine =
          "data:image/jpeg;base64,";
      }

      try {
        await setDoc(doc(db, "users", email, "logos", Date.now().toString()), {
          image: base64ImageWithMine,
          title: title || "Untitled Logo",
          desc: desc || "No description provided",
        });
        console.log("Image saved to Firestore successfully");
      } catch (e) {
        console.error("Firestore save error:", e);
      }

      return NextResponse.json({ Image: base64ImageWithMine });
    } catch (huggingFaceError) {
      console.error(
        "Hugging Face API Error:",
        huggingFaceError.response?.data || huggingFaceError.message
      );
      return NextResponse.json(
        {
          error: "Failed to generate image",
          details: huggingFaceError.response?.data || huggingFaceError.message,
        },
        { status: 500 }
      );
    }
  } catch (e) {
    console.error("API Error:", e);
    return NextResponse.json(
      {
        error: e.message,
        stack: e.stack,
      },
      { status: 500 }
    );
  }
}
